import React from 'react';

interface Props {
  clicked: () => unknown;
  text: string;
}

export const Button = (props: Props) => {
  const { clicked, text } = props;
	return (
    <button className="button" 
            data-theme="light"
            onClick={clicked}>
      {text}
    </button>
  )
}
